      | 355445 -> { ItemTypeData.id= 355445; name= "QA God Suit"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient equipment hard points for mission-specific customizations.  A flat-coil e5000 fifth generation fusion core runs up the inside of the back plate, powering the entire suit. Its output and heat buildup are controlled by a L2 “Gatekeeper” regulator conduit, which connects directly to the sensor system at the base of the neck. Every joint is reinforced with kinetic sensors and two-way, high torque servos to enhance the soldier's strength, balance, and resistance to impact forces. The suit's helmet has more integrated sensor, communication, targeting, and data processing systems than most civilian vehicles. Furthermore, every armor plate on the suit is energized to absorb the force of incoming plasma-based projectiles, neutralizing their ionization and reducing thermal damage.  Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment's notice. Its ability to carry anything from small arms and explosives to heavy anti-vehicle munitions and deployable support gear makes it the most adaptable suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
